import '../index.css';

import { useTranslation } from 'react-i18next';


export default function Navbar () {
    const {t} = useTranslation(); 

    return (
        <>
        <li onClick={()=> {window.location.href = "/age"}}>{t('navbar_age')}</li>
        <li onClick={()=> {window.location.href = "/balanced"}}>{t('navbar_balanced')}</li>
        <li onClick={()=> {window.location.href = "/"}}>{t('navbar_home')}</li>
        </>
    )
};
